export default function About() {
  return (
    <div className="min-h-screen bg-white">
      {/* Header */}
      <div className="p-12">
        <h1 className="text-5xl font-bold mb-8">Über mich</h1>
      </div>

      {/* Bild & Text nebeneinander */}
      <div className="grid grid-cols-2 gap-8 p-12">
        <img src="/images/Lovelace_Algorithmus_Auszug.jpg" alt="Foto" className="w-full rounded-lg" />
        <div>
          <h2 className="text-2xl mb-4">Ada Lovelace</h2>
          <p className="text-lg leading-relaxed">
            „Die Maschine könnte auch andere Dinge außer Zahlen bearbeiten, wenn sich Objekte finden ließen, deren Beziehungen durch die abstrakte Wissenschaft der Operationen ausgedrückt werden können und die sich für Befehle und den Mechanismus des Geräts eignen.“
          </p>
        </div>
      </div>
    </div>
  )
}
